import React, { Component } from 'react';
import './index.css';

const SeriesListItem = ({ series }) => (
        <li>
            {series}
        </li>
)

const SeriesList = (props) => {
    return (
        <div>
            Series List component:
            <ul className = "series-list">
                {props.list.map(item =>( 
                    <SeriesListItem series = {item} key={series} />
                ))}
            </ul>
        </div>
    )
}

export default SeriesList;
